// Experience.jsx
import React from "react";

const Experience = ({ darkMode }) => (
  <section id="experience" className={`py-20 px-4 sm:px-6 md:px-8 ${darkMode ? 'bg-gray-900 text-white' : 'bg-white'}`}>
    <h2 className="text-3xl font-bold mb-6">Experience</h2>
    <div className={`p-4 rounded-xl ${darkMode ? 'bg-gray-700' : 'bg-gray-100'}`}>
      <h3 className="text-xl font-semibold">Software Development Intern – Coincent.ai (Aug 2024 – Oct 2024)</h3>
      <ul className="list-disc ml-5 mt-2">
        <li>Automated data reporting, reduced manual effort by 30%</li>
        <li>Improved documentation and team workflows</li>
        <li>Worked on backend/frontend with Java and Python</li>
        <li>Developed real-world production modules</li>
      </ul>
    </div>
  </section>
);

export default Experience;
